import { useSelector } from "react-redux";

function Cart() {
  // const cart = useSelector((state) => state.cart.cartList);
  const cart = localStorage.getItem("cart").split(" ");
  let cartdata = [];
  cart.forEach((c) => {
    cartdata.push({ id: c });
  });
  console.log(cartdata);
  return (
    <div>
      Here is your cart
      {cart.map((c) => {
        return (
          <div>
            {c[0]}
            {c[1]}
          </div>
        );
      })}
    </div>
  );
}

export default Cart;
